import React from 'react';

class GetRequest extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            code: null 
        };
    }

    componentDidMount() {
        const requestOptions = {
            mode: 'no-cors',
            method: 'GET',
            headers: { 
                'Content-Type' : 'application/json',
                'Accept' : 'application/json'
            }
        };
        fetch('https:///localhost:8080/docker')
            .then(response => response.json())
            .then((result) => this.setState({code : result.boodId}));
    }

    render() {
        return (
            <div>
                {this.state.code}
            </div>
        );
    }
}

export default GetRequest;
